    return (
      <div>
        <span>{this.cc()}</span>
        <h1>First Component</h1>
        <button>Increment</button>
      </div>
    );
  }
  cc() {
    var i;
    for (i = 0; i < 10; i++) {
      return <h1>{this.state.count}</h1>;
    }
  }
}

export default Counter;
